import React from 'react';
import './App.css';
import Blog from './blog';

const posts = [
  { title: 'First Post', content: 'This is the content of the first post.' },
  { title: 'Second Post', content: 'This is the content of the second post.' },
];

function App() {
  return (
    <div className="App">
      <h1>My Blog</h1>
      <Blog posts={posts} />
    </div>
  );
}

export default App;
